class Solution(object):
    def find132pattern(self, nums):
        """
        :type nums: List[int]
        :rtype: bool
        """
        N = len(nums)
        i=0
        while i<N:
            print (i)
            for j in range(i + 1, N):
                for k in range(j + 1, N):
                    if k==4:
                        print ("i=?", i, "j=?", j, "k=?", k, "end")
                    if nums[i]<nums[k] and nums[k]<nums[j]:
                        return True
            i+=1
        return False

    #this is also TLE
    def find132pattern_(self, nums):
        """
        :type nums: List[int]
        :rtype: bool
        """
        N = len(nums)
        m = {}
        for i in range(N):
            for k in range(i + 2, N):
                if nums[i] < nums[k]:
                    m[(i, k)] = 1

        # for j in range(1,N):
        print (m)
        for x in m:
            for j in range(x[0] + 1, x[1]):
                #print "j=?", j
                if nums[j] > nums[x[1]]:
                    return True
        return False
o=Solution()
nums=[3,1,4,2]
print (o.find132pattern_(nums))

